import React from 'react';
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <h3>Stranger's Things</h3>
            <div>
                <Link to="/home">Home</Link>
                <Link to="/profile">Profile</Link>
                <Link to="/posts">Posts</Link>

            </div>
        </nav>
    );
}
export default Navbar;
